import{_ as e,o as a,c as t,O as i}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 63.2-621 Restrictions on use of TANF cash assistance.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-621.md","filePath":"vacode/63.2-621.md"}'),r={name:"vacode/63.2-621.md"},s=i('<h1 id="§-63-2-621-restrictions-on-use-of-tanf-cash-assistance" tabindex="-1">§ 63.2-621 Restrictions on use of TANF cash assistance. <a class="header-anchor" href="#§-63-2-621-restrictions-on-use-of-tanf-cash-assistance" aria-label="Permalink to &quot;§ 63.2-621 Restrictions on use of TANF cash assistance.&quot;">​</a></h1><p>Recipients of TANF benefits pursuant to this chapter shall not access TANF cash benefits through an electronic benefit transaction (i) for the purchase of alcoholic beverages, tobacco products, lottery tickets, or sexually explicit visual materials as defined in § <a href="http://law.lis.virginia.gov/vacode/18.2-374.1/" target="_blank" rel="noreferrer">18.2-374.1</a>; (ii) in any transaction in any (a) government store established for the sale of alcoholic beverages, (b) establishment in which pari-mutuel wagering or charitable gaming is conducted, or (c) establishment in which tattooing or body-piercing, as defined in § <a href="http://law.lis.virginia.gov/vacode/54.1-700/" target="_blank" rel="noreferrer">54.1-700</a>, is performed for hire or consideration; or (iii) in any establishment that provides adult-oriented entertainment in which performers or other individuals connected with the business appear nude or partially nude.</p><p>2013, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0160" target="_blank" rel="noreferrer">160</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0733" target="_blank" rel="noreferrer">733</a>.</p>',3),n=[s];function o(c,l,h,d,f,p){return a(),t("div",null,n)}const g=e(r,[["render",o]]);export{u as __pageData,g as default};
